    private static void testLoop(int numOfTest, Recursive r){
     int counter = 0;
     for(int i = 0; i < numOfTest; i++){
         Random rand = new Random();
         int num = rand.nextInt(numOfTest * 10);
         boolean val = assertTest(  num, Integer.parseInt(r.getBinary(num), 2)); 
         if(val){
          counter++;
         }
        }
     if(counter == numOfTest){
      System.out.print("**Passed** getBinary | ");
     } else {
      System.out.print("!!FAILED!!");
     }
     System.out.println("Number of Tests passed: " + counter + "/" + numOfTest);
     
    }
    
