     System.out.println(expected == actual ? "Test " + test++ + " passed. " + method :
       "Test " + test++ + " FAILED!! " + method);
     
     data = new int[]{2, 0};
     actual = r.nextIsDouble(data);
     System.out.println(expected == actual ? "Test " + test++ + " passed. " + method :
       "Test " + test++ + " FAILED!! " + method);
     
     expected = 1;
     data = new int[]{0, 0};
     actual = r.nextIsDouble(data);
     System.out.println(expected == actual ? "Test " + test++ + " passed. " + method :
       "Test " + test++ + " FAILED!! " + method);
     
